import Child1 from './Child';
class App extends Component {
  componentDidMount(){
  }
  constructor(props){
    super(props)
    this.state={'count':0}

  }
  handleClick=()=>{
    var tmp =  this.state.count
    this.setState({'count': tmp + 1})
  }
  render() {
    return (<div>
      <button onClick={()=>this.handleClick}>Click Me</button>
      <div>{"count is: " + this.state.count}</div>
      <Child1 name={"name1"} age={22}></Child1>
      <Child1 name={"name2"} age={33}></Child1>
    </div>);
  }
}

export default App;
